// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.4;

import "./DonationCampaign.sol";

contract DonationFactory {
    address[] public campaigns;

    event CampaignCreated(address campaignAddress, string name);

    function createCampaign(string memory name) public {
        Campaign newCampaign = new Campaign(name);
        campaigns.push(address(newCampaign));
        emit CampaignCreated(address(newCampaign), name);
    }

    function getCampaigns() public view returns (address[] memory) {
        return campaigns;
    }
}

